import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

const Navbar = () => {
  // const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [anchorElUser, setAnchorElUser] = React.useState(null);

  // const handleOpenNavMenu = (event) => {
  //   setAnchorElNav(event.currentTarget);
  // };
  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  // const handleCloseNavMenu = () => {
  //   setAnchorElNav(null);
  // };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };

  return (
    <AppBar position="static" className='header-wrapper'>
      <div className='container'>
        <Toolbar disableGutters>
          <div className="header-wrapper">
            <div className="header-left">
              <div className="logo-blk">
                <a href="/#">
                  <img src={process.env.PUBLIC_URL + '/images/logo.png'} className="img-fluid" alt="" />
                </a>
              </div>
              <div className="nav-listblk">
                <ul className="nav-list flex-between">
                  <li><a href="/#">Dashboard</a></li>
                  <li className="active"><a href="/#">Members</a></li>
                  <li><a href="/#">Operation Members</a></li>
                  <li><a href="/#">Questionnaires</a></li>
                  <li><a href="/#">Sub Admins</a></li>
                  <li><a href="/#">Roles and Privileges</a></li>
                </ul>
              </div>
            </div>
            <div className="header-right">
              <Box>
                <Tooltip title="Open settings">
                  <div className="user-blk flex-between">
                    <div className="user-img">
                      <span className='user-name-txt'>ER</span>
                      {/* <IconButton onClick={handleOpenUserMenu} sx={{ p: 0 }}>
                        <Avatar alt="Remy Sharp" src="/static/images/avatar/2.jpg" />
                      </IconButton> */}
                    </div>
                    <div className="user-info">
                      <span className="user-name">Erin</span>
                      <span className="user-type" onClick={handleOpenUserMenu}>Super Admin <span className="super-admin-arrow"><KeyboardArrowDownIcon /></span></span>
                    </div>
                  </div>
                </Tooltip>
                <Menu
                  sx={{ mt: '45px' }}
                  id="menu-appbar"
                  anchorEl={anchorElUser}
                  anchorOrigin={{
                    vertical: 'top',
                    horizontal: 'right',
                  }}
                  keepMounted
                  transformOrigin={{
                    vertical: 'top',
                    horizontal: 'right',
                  }}
                  open={Boolean(anchorElUser)}
                  onClose={handleCloseUserMenu}
                >
                  {settings.map((setting) => (
                    <MenuItem key={setting} onClick={handleCloseUserMenu}>
                      <Typography textAlign="center">{setting}</Typography>
                    </MenuItem>
                  ))}
                </Menu>
              </Box>
            </div>
          </div>
        </Toolbar>
      </div>
    </AppBar>
  );
};
export default Navbar;
